  false,\n\t\"url\": null,\n\t\"notes\": \"The St. Louis air quality nonattainment
  areas geospatial data layer contains regions representing the geographic extent
  of areas that are estimated to be out of compliance with the United States Environmental
  Protection Agency's (EPA) air quality guidelines. The St. Louis area is currently
  designated as a moderate 8-hour ozone nonattainment area. The nonattainment area
  is located on both sides of the Mississippi River, the dividing line between Missouri
  and Illinois. The Illinois portion consists of Madison, Monroe, St. Clair and Jersey
  Counties. The Missouri portion of the nonattainment area consists of Franklin, Jefferson,
  St. Charles and St. Louis Counties and St. Louis City. The department has prepared
  numerous air quality planning documents to meet state and federal clean air mandates
  to address ozone pollution in the St. Louis area. In 1997 the ozone National Ambient
  Air Quality Standards (NAAQS) was reviewed, and EPA recommended that the ozone standard
  be changed from 0.12 parts per million of ozone measured over one hour to a standard
  of 0.08 parts per million measured over eight hours, with the average fourth highest
  concentration over a three-year period determining whether an area is in compliance.
  The city of Herculaneum is included in this data set because it is designated as
  a nonattainment area for lead.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
